function dxdt = odefunc_revB(t, x, exp2_fca_40, paramfile, outflag)
% dxdt = odefunc_revA(t, x, exp2_fca_40, paramfile) calculates the state
% derivatives from states. paramfile is the file containing the parameters
% (mass, radius, inertia, etc) for the simulation run. 
%
% INPUTS:
%   t           = time, seconds
%   x           = state vector (see below)
%   exp2_fca_40 = mass position, velocity, and accleration profiles
%   Crr0        = rolling resistance coefficient
%
% OUTPUTS:
%   dxdt        = vector of state derivatives
%
% The state vector is:
%   x = [theta, theta_d, ry1, ry2, rz3, rz4, vy1, vy2, vz3, vz4]
%
% The state derivative vector is:
%   x = [theta_d, theta_dd, ry1d, ry2d, rz3d, rz4d, vy1d, vy2d, vz3d, vz4d]

% -------------------------------------------------------------------
% Modification table
% CDY, 07-20-2019, Added functionality to handle both revA and revB
% versions of GetMassPosition function.

t

% unpack states
tta = x(1);     % rad
ttad = x(2);    % rad/s

% default parameters - old file compatability
massfunct = 'revA';         % assume cone angle for old file compatability

% unpack parameters
eval(paramfile);                % load parameters to script workspace
Crr = Crr0*tanh(ttad/w_lim);   % find new coefficient based on correction
% Crr = Crr0*(ttad/abs(ttad));


% mass motion
if exist('sp', 'var') ~= 1
    sp = NaN;
end

if strcmp(massFlag, 'sim') == 1
    % simulate!
    ttaB = mod(tta, 2*pi);      % on the interval [0, 2*pi]
%     [x1, x2, y3, y4, x1d, x2d, y3d, y4d, x1dd, x2dd, y3dd, y4dd] = ...
%         GetMassPositions(x, ca, LL, UL, mv, t);
    if strcmp(massfunct, 'revA') == 1
        [x1, x2, y3, y4, x1d, x2d, y3d, y4d, x1dd, x2dd, y3dd, y4dd] = ...
            GetMassPositions_revA(x, ca, LL, UL, mv, t, sp);
        
    elseif strcmp(massfunct, 'revB') == 1
        mT = m1 + m2 + m3 + m4 + mCH;
        [x1, x2, y3, y4, x1d, x2d, y3d, y4d, x1dd, x2dd, y3dd, y4dd] = ...
            GetMassPositions_revB(x, LL, UL, mv, t, sp, kP_vel, m, mT);
    else
        error('Please specify massfunct as either revA or revB.');
    end
    
else
    % match experiment
    [~, indx] = min(abs(exp2_fca_40(:, 1) - t));    % finding index of time...
                                                    % instance(from the experimental data)...
                                                    % closest to the time instance 't' in ode 
    dt = exp2_fca_40(indx + 1, 1) - exp2_fca_40(indx, 1);
    dy = exp2_fca_40(indx + 1, 2:end) - exp2_fca_40(indx, 2:end);
    dx = t - exp2_fca_40(indx, 1);
    yt = exp2_fca_40(indx, 2:end) + dy.*dx./dt;
%     x1 = yt(1);         % m
%     x2 = yt(2);         % m
%     y3 = yt(3);         % m
%     y4 = yt(4);         % m
%     x1d = yt(5);        % m/s
%     x2d = yt(6);        % m/s
%     y3d = yt(7);        % m/s
%     y4d = yt(8);        % m/s
%     x1dd = yt(9);       % m/s/s
%     x2dd = yt(10);      % m/s/s
%     y3dd = yt(11);      % m/s/s
%     y4dd = yt(12);      % m/s/s
    x1 = yt(3);         % m
    x2 = yt(4);         % m
    y3 = yt(1);         % m
    y4 = yt(2);         % m
    x1d = yt(7);        % m/s
    x2d = yt(8);        % m/s
    y3d = yt(5);        % m/s
    y4d = yt(6);        % m/s
    x1dd = yt(11);       % m/s/s
    x2dd = yt(12);      % m/s/s
    y3dd = yt(9);      % m/s/s
    y4dd = yt(10);      % m/s/s
end

% --------------------------------------------------------------------

% % Hartl implicit equations
% % opts = optimoptions('fsolve', 'Algorithm', 'levenberg-marquardt', 'Display', 'none');
% opts = optimoptions('fsolve', 'Display', 'none');
% global Ff_old N_old ttadd_old
% x0 = [Ff_old, N_old, ttadd_old];
% [xval, fval] = fsolve(@(xx)SolveHartl(xx, tta, ttad, x1, x2, y3, y4, x1d, x2d, ...
%     y3d, y4d, x1dd, x2dd, y3dd, y4dd, mCH, I_B_B, Crr, R, g, m1, m2, m3, m4), x0, opts);
% Ff_old = xval(1);
% N_old = xval(2);
% ttadd_old = xval(3);

% ----------------------------------------------------------------------

% % Hartl inertial equations -> CM = B
% N = g*mCH;
% Ff = (Crr*I_B_B*abs(g*mCH))/(I_B_B + R^2*mCH);
% ttadd = -(Crr*R*abs(g*mCH))/(I_B_B + R^2*mCH);

% % Relative equations -> CM =/= B
% N = (R^2*m1^2*x1dd*cos(tta) - R*m1^2*ttad^2*x1^2 + m1^2*x1^2*x1dd*cos(tta) + I_B_B*m1*x1dd*cos(tta) + R*m1^2*x1*x1dd + R^2*g*m1^2*cos(tta)^2 + R^2*g*mCH^2*cos(tta)^2 + R^2*g*m1^2*sin(tta)^2 + R^2*g*mCH^2*sin(tta)^2 + g*m1^2*x1^2*cos(tta)^2 - m1^2*ttad^2*x1^3*cos(tta) + I_B_B*g*m1*cos(tta)^2 + I_B_B*g*mCH*cos(tta)^2 + I_B_B*g*m1*sin(tta)^2 + I_B_B*g*mCH*sin(tta)^2 - R^2*m1^2*ttad^2*x1*cos(tta) + R*g*m1^2*x1*cos(tta) - I_B_B*m1*ttad^2*x1*cos(tta) + R^2*m1*mCH*x1dd*cos(tta) - R*m1^2*ttad^2*x1^2*cos(tta)^2 + 2*R^2*g*m1*mCH*cos(tta)^2 + R*g*m1^2*x1*cos(tta)^3 + 2*R^2*g*m1*mCH*sin(tta)^2 + R*m1^2*x1*x1dd*cos(tta)^2 + g*m1*mCH*x1^2*cos(tta)^2 - 2*R^2*m1^2*ttad*x1d*sin(tta) + g*m1*mCH*x1^2*sin(tta)^2 - 2*I_B_B*m1*ttad*x1d*sin(tta) - R^2*m1*mCH*ttad^2*x1*cos(tta) + R*g*m1*mCH*x1*cos(tta) + R*g*m1^2*x1*cos(tta)*sin(tta)^2 + R*g*m1*mCH*x1*cos(tta)^3 - 2*R^2*m1*mCH*ttad*x1d*sin(tta) + R*g*m1*mCH*x1*cos(tta)*sin(tta)^2 - 2*R*m1^2*ttad*x1*x1d*cos(tta)*sin(tta))/(I_B_B*cos(tta)^2 + I_B_B*sin(tta)^2 + R^2*m1*cos(tta)^2 + R^2*mCH*cos(tta)^2 + R^2*m1*sin(tta)^2 + R^2*mCH*sin(tta)^2 + m1*x1^2*cos(tta)^2 + m1*x1^2*sin(tta)^2 + R*m1*x1*cos(tta) + R*m1*x1*cos(tta)^3 + R*m1*x1*cos(tta)*sin(tta)^2 - Crr*R*m1*x1*sin(tta));
% Ff = (m1^2*x1^2*x1dd*sin(tta) + I_B_B*m1*x1dd*sin(tta) - m1^2*ttad^2*x1^3*sin(tta) + Crr*I_B_B*g*m1*sin(tta)^2 + Crr*I_B_B*g*mCH*sin(tta)^2 + g*m1^2*x1^2*cos(tta)*sin(tta) - I_B_B*m1*ttad^2*x1*sin(tta) + Crr*m1^2*x1^2*x1dd*cos(tta) + R*g*m1^2*x1*sin(tta)^3 + Crr*I_B_B*m1*x1dd*cos(tta) + 2*I_B_B*m1*ttad*x1d*cos(tta) + Crr*g*m1^2*x1^2*cos(tta)^2 - Crr*m1^2*ttad^2*x1^3*cos(tta) + Crr*I_B_B*g*m1*cos(tta)^2 + Crr*I_B_B*g*mCH*cos(tta)^2 + Crr*g*m1*mCH*x1^2*sin(tta)^2 - 2*R*m1^2*ttad*x1*x1d*sin(tta)^2 - 2*Crr*I_B_B*m1*ttad*x1d*sin(tta) + R*m1^2*x1*x1dd*cos(tta)*sin(tta) + R*g*m1^2*x1*cos(tta)^2*sin(tta) - Crr*I_B_B*m1*ttad^2*x1*cos(tta) - Crr*R*m1^2*ttad^2*x1^2*cos(tta)^2 + R*g*m1*mCH*x1*sin(tta)^3 + Crr*R*g*m1^2*x1*cos(tta)^3 + Crr*R*m1^2*x1*x1dd*cos(tta)^2 - R*m1^2*ttad^2*x1^2*cos(tta)*sin(tta) + Crr*g*m1*mCH*x1^2*cos(tta)^2 - 2*R*m1*mCH*ttad*x1*x1d*cos(tta)^2 - 2*R*m1*mCH*ttad*x1*x1d*sin(tta)^2 + R*g*m1*mCH*x1*cos(tta)^2*sin(tta) + Crr*R*g*m1^2*x1*cos(tta)*sin(tta)^2 + Crr*R*g*m1*mCH*x1*cos(tta)^3 + Crr*R*g*m1*mCH*x1*cos(tta)*sin(tta)^2 - 2*Crr*R*m1^2*ttad*x1*x1d*cos(tta)*sin(tta))/(I_B_B*cos(tta)^2 + I_B_B*sin(tta)^2 + R^2*m1*cos(tta)^2 + R^2*mCH*cos(tta)^2 + R^2*m1*sin(tta)^2 + R^2*mCH*sin(tta)^2 + m1*x1^2*cos(tta)^2 + m1*x1^2*sin(tta)^2 + R*m1*x1*cos(tta) + R*m1*x1*cos(tta)^3 + R*m1*x1*cos(tta)*sin(tta)^2 - Crr*R*m1*x1*sin(tta));
% ttadd = -(R*m1*x1dd*sin(tta) - g*m1*x1*sin(tta)^3 + Crr*R*g*m1*cos(tta)^2 + Crr*R*g*mCH*cos(tta)^2 + Crr*R*g*m1*sin(tta)^2 + Crr*R*g*mCH*sin(tta)^2 - R*m1*ttad^2*x1*sin(tta) + 2*m1*ttad*x1*x1d*cos(tta)^2 + 2*m1*ttad*x1*x1d*sin(tta)^2 + Crr*R*m1*x1dd*cos(tta) - g*m1*x1*cos(tta)^2*sin(tta) + 2*R*m1*ttad*x1d*cos(tta) - 2*Crr*R*m1*ttad*x1d*sin(tta) - Crr*R*m1*ttad^2*x1*cos(tta))/(I_B_B*cos(tta)^2 + I_B_B*sin(tta)^2 + R^2*m1*cos(tta)^2 + R^2*mCH*cos(tta)^2 + R^2*m1*sin(tta)^2 + R^2*mCH*sin(tta)^2 + m1*x1^2*cos(tta)^2 + m1*x1^2*sin(tta)^2 + R*m1*x1*cos(tta) + R*m1*x1*cos(tta)^3 + R*m1*x1*cos(tta)*sin(tta)^2 - Crr*R*m1*x1*sin(tta));

% Relative equations w/ four masses -> CM =/= B
